class Buffer(BinaryParser):
    """
    function(t, e) {
        this.bigEndian = t || 0,
        this.buffer = [],
        this.setBuffer(e)
    }
    Returns:

    """

    def __init__(self, t, e):
        self.bigEndian = t or 0
        self.buffer = []
        self.setBuffer(e)

    def readBits(self, t, e):
        """
        p.readBits = function(t, e) {
            function i(t, e) {
                for (++e; --e; t = 1073741824 == (1073741824 & (t %= 2147483648)) ? 2 * t : 2 * (t - 1073741824) + 2147483647 + 1)
                    ;
                return t
            }
            if (0 > t || 0 >= e)
                return 0;
            this.checkBuffer(t + e);
            for (var n, r = t % 8, o = this.buffer.length - (t >> 3) - 1, s = this.buffer.length + (-(t + e) >> 3), a = o - s, l = (this.buffer[o] >> r & (1 << (a ? 8 - r : e)) - 1) + (a && (n = (t + e) % 8) ? (this.buffer[s++] & (1 << n) - 1) << (a-- << 3) - r : 0); a; l += i(this.buffer[s++], (a-- << 3) - r))
                ;
            return l
        }
        Args:
            t: 
            e: 

        Returns:

        """

        def inner_i(t, e):
            e += 1
            while e:
                e -= 1
                t %= 2147483648
                if 1073741824 & t:
                    t = 1073741824 == 2 * t
                else:
                    t = 2 * (t - 1073741824) + 2147483647 + 1
            return t

        if 0 > t or 0 >= e:
            return 0
        self.checkBuffer(t + e)

        r = t % 8
        o = len(self.buffer) - (t >> 3) - 1
        s = len(self.buffer) + (-(t + e) >> 3)
        a = o - s
        # l =  ? (this.buffer[s++] & (1 << n) - 1) << (a-- << 3) - r : 0)
        # (this.buffer[o] >> r & (1 << (a ? 8 - r: e)) - 1) + (a & & (n = (t + e) % 8)
        if a:
            tmp = 8 - r
        else:
            tmp = e
        n = (t + e) % 8
        if (self.buffer[o] >> r & (1 << tmp) - 1) + (a and n):
            s += 1
            a -= 1
            l = (self.buffer[s] & (1 << n) - 1) << (a << 3) - r
        else:
            l = 0

        while a:
            s += 1
            a -= 1
            l += inner_i(self.buffer[s], (a << 3) - r)

        return l

    def checkBuffer(self, t):
        """
        p.checkBuffer = function(t) {
            if (!this.hasNeededBits(t))
                throw Error("checkBuffer::missing bytes")
        }
        Args:
            t: 

        Returns:

        """
        if not self.hasNeededBits(t):
            raise Exception("checkBuffer::missing bytes")

    def hasNeededBits(self, t):
        """
        hasNeededBits = function(t) {
            return this.buffer.length >= -(-t >> 3)
        }
        Args:
            t: 

        Returns:

        """
        return len(self.buffer) >= -(-t >> 3)


