def duokan_e(t, e):
    """
    base64decoded, 0
    
    function e(t, e) {
            for (var i = 1, n = t.charCodeAt(e), r = n, o = 128; 4 >= i && 0 != (o & n); )
                o >>= 1,
                i++,
                r = (r << 1) % 256;
            for (var s = 0; i - 1 > s; s++)
                r >>= 1;
            var a = r;
            for (s = 1; i > s; s++)
                a = (a << 8) + t.charCodeAt(e + s);
            return [e + i, a]
        }
    """
    i = 1
    n = ord(t[e: e + 1])
    r = n
    o = 128
    while 4 >= i and 0 != (o & n):
        o >>= 1
        i += 1
        r = (r << 1) % 256
    s = 0
    while i - 1 > s:
        s += 1
        r >>= 1
    a = r
    # for i in range(1, i):
    s = 1
    while i > s:
        a = (a << 8) + ord(t[e + s: e + s + 1])
        s += 1
    return [e + i, a]


